import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import { Card } from 'react-bootstrap';
import "./style.css";

function Work(props) {
    return (
        <>
        <Card>
        <Card.Header as="h4">Previous Work</Card.Header>
        <Card.Body>
            <Card.Text>
                <img 
                    src={require("../../assets/icons/nzdf.png")}
                    alt="nzdf"
                    className="nzdf-image"
                />
                <h4>Team Leader - Heavy Diesel Mechanic</h4>
            </Card.Text>
        </Card.Body>
        </Card>

        <Card>
        <Card.Header as="h4">Education</Card.Header>
        <Card.Body>
            <Card.Text>
                <img 
                    src={require("../../assets/icons/nzdf.png")}
                    alt="nzdf"
                    className="nzdf-image"
                />
                <h5>Team Leader - Heavy Diesel Mechanic</h5>
            </Card.Text>
        </Card.Body>
        </Card>
        </>
    );
}

export default Work;
